import React from 'react'
import '../styles/Details.css'

export default function Details() {
  return (
    <div className="id">
    <div className="id1">
        <img src="image.jpg" className="id2"/>
        <div className="id3">Create an account</div>
        <div className="id4">Login</div>
    </div>
    </div>
  )
}
